import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import LoginPage from '../pages/LoginPage';
import AdminDashboard from '../pages/Admin/AdminDashboard';
import RegisterAdmin from '../pages/Admin/RegisterAdmin';
import AddTeacher from '../pages/Admin/AddTeacher';
import AddCounselor from '../pages/Admin/AddCounselor';
import History from '../pages/Admin/History';
import TeacherDashboard from '../pages/Teacher/TeacherDashboard';
import CounselorDashboard from '../pages/Counselor/CounselorDashboard';
import ProtectedRoute from './ProtectedRoute'; // Import the ProtectedRoute component

const AppRoutes = () => {
  return (
    <Routes>
      {/* Redirect "/" to "/login" */}
      <Route path="/" element={<Navigate to="/login" />} />
      <Route path="/login" element={<LoginPage />} />
      <Route path="/register" element={<RegisterAdmin />} />
      
      {/* Use ProtectedRoute for the routes that require authentication */}
      <Route path="/adminDashboard" element={<ProtectedRoute element={<AdminDashboard />} />} />
      <Route path="/addTeacher" element={<ProtectedRoute element={<AddTeacher />} />} />
      <Route path="/addCounselor" element={<ProtectedRoute element={<AddCounselor />} />} />
      <Route path="/history" element={<ProtectedRoute element={<History />} />} />
      <Route path="/teacherDashboard" element={<ProtectedRoute element={<TeacherDashboard />} />} />
      <Route path="/counselorDashboard" element={<ProtectedRoute element={<CounselorDashboard />} />} />
    </Routes>
  );
};

export default AppRoutes;
